// Helper functions
func getIssuesAlpineData(res *warnly.ListIssuesResult) string {
	period := "14d"
	if res.Request.Period != "" {
		period = res.Request.Period
	}

	filters := "[]"
	if res.Request.Query != "" {
		filters = "[]"
	}

	return fmt.Sprintf(`issueFilters({
		filters: %s,
		searchQuery: '%s',
		period: '%s',
		projectName: '%s',
		offset: %d,
		totalIssues: %d,
		tokens: %s,
		start: '%s',
		end: '%s'
	})`, filters, res.Request.Query, period, res.RequestedProject, res.Request.Offset, res.TotalIssues, getSearchTokens(res.Request), res.Request.Start, res.Request.End)
}

func getSelectedProjectName(requestedProject string) string {
	if requestedProject == "" {
		return "All Projects"
	}
	return requestedProject
}

func getPeriodOrDefault(period string) string {
	if period == "" {
		return "14d"
	}
	return period
}

func getSearchTokens(req *warnly.ListIssuesRequest) string {
	if req.Query == "" {
		return "[]"
	}
	tokens := warnly.ParseQuery(req.Query)
	jsonBytes, _ := json.Marshal(tokens)
	return string(jsonBytes)
}

func getPopularTagsCategories(tags []warnly.TagCount) string {
	items := []map[string]string{}
	for _, t := range tags {
		items = append(items, map[string]string{
			"key":   t.Tag,
			"value": t.Tag,
		})
	}
	categories := []map[string]any{
		{
			"name":   "Tags",
			"active": true,
			"items":  items,
		},
	}

	jsonBytes, _ := json.Marshal(categories)

	return string(jsonBytes)
}

func getProjectName(projects []warnly.Project, projectID int) string {
	for _, p := range projects {
		if p.ID == projectID {
			return p.Name
		}
	}
	return "Unknown"
}

